According to the law, the national anthem must be played or sung during the following occasions:

1. During the flag-raising ceremony of the People's Republic of China;
2. During the opening ceremony of the National People's Congress;
3. During the opening ceremony of the Chinese New Year;
4. During the National Day celebrations;
5. During the Chinese New Year celebrations;
6. During other important national events as designated by the state.

The law also provides for the punishment for those who fail to comply with the rules for playing and singing the national anthem, including:

1. Fines of up to 10,000 yuan;
2. Imprisonment of up to 15 days;
3. Public criticism;
4. Loss of political rights for a period of up to three years.

It is important to note that the National Anthem Law of the People's Republic of China is a national law, and its provisions are binding on all citizens, legal persons and organizations within the territory of the People's Republic of China.

